import NavLink from "./NavLink";
import styled from "styled-components";

const Nav = () => {
  return (
    <>
      <StyledNav>
        <StyledLink>
          <NavLink content={"Tristan D'Amours"} />
        </StyledLink>
        <StyledLink>
          <NavLink content={"About"} />
        </StyledLink>
        <StyledLink>
          <NavLink content={"Published Work"} />
        </StyledLink>
        <StyledLink>
          <NavLink content={"Contact"} />
        </StyledLink>
      </StyledNav>
    </>
  );
};

export default Nav;

const StyledNav = styled.ul`
  border: 5px solid skyblue;
  font-variant: small-caps;
  list-style-type: none;
  margin-top: 0;
  margin-right: 30px;
  max-width: 25%;
  padding: 16px;
  @media (max-width: 768px) {
    max-width: 100%;
    margin-right: 0;
  }
`;

const StyledLink = styled.li`
  border-bottom: 2.5px dashed skyblue;
  display: box;
  font-size: 40px;
  padding: 16px;
  text-align: center;
`;
